import React from "react";

class Login extends React.Component{
    render() {
        return (
            <div class="center">

                <h1>[WebseiteName] <br/>Login </h1>

                <form>
                        <div class="txt_field">
                        <input type="text" id="email" name="email" required/>
                        <span></span>
                        <label>Enter Email</label>
                        </div>
                        
                </form>
            </div>
      );
    }
}

export default Login;
